scriptlet.script:
try {
	sql = "select VMNAME_PART,HOSTNAME_PART from ENA_NAMING where LAB_ID = '" + labID + "'"; 
	scriptletResult = sql;
	scriptletContext.put("SQL",sql);
	scriptletResponse = "success";
}
catch(Error) {
	scriptletResponse = "failure";
	scriptletContext.put("FailureMessage",Error);
}

try {
	var slist = JSON.parse(serverList);

	// Update serverList about VM Names
	Object.keys(slist).forEach(function(j) {
		var role = slist[j].role;
		var counter = slist[j].counter;
		var resourcing = slist[j].resourcing;
		var tmp = slist[j];

		// process hostname and vmname
		if(resourcing == "DHCP") {
			var hostName = "ps";
			hostName = hostName.concat(hPart);
			hostName = hostName.concat("l",labInstance);
			hostName = hostName.concat("s",counter);
			tmp["hostName"] = hostName;
			var vmName = "suo-ps-lab";
			vmName = vmName.concat("-",vPart);	
			vmName = (customerName.trim() != "")? vmName.concat("-",customerName.toLowerCase()): vmName;
			vmName = vmName.concat("-",hostName);
			vmName = vmName.concat("-",role);
			tmp["vmName"] = vmName;			
		}
		else {
			var vmName = "suo-ps-lab";
			vmName = vmName.concat("-",vPart);	
			vmName = (customerName.trim() != "")? vmName.concat("-",customerName.toLowerCase()): vmName;
			vmName = vmName.concat("-","${HOSTNAME}");
			vmName = vmName.concat("-",role);
			tmp["vmName"] = vmName;
		}
		slist[j] = tmp;
	});

	scriptletContext.put("serverList",JSON.stringify(slist,null,2));
	scriptletResult=JSON.stringify(slist);
	scriptletResponse="success";
}
catch(Error) {
	scriptletContext.put("FailureMessage",Error);
	scriptletResponse="failure";
}

var pr = scriptletContext.get("RS_Previous_Response");

switch(pr) {
	case "more items":
		if(output.trim().length > 0) {
			// VMNAME_PART,HOSTNAME_PART
			var array = output.split("|");
			var vPart = array[0];
			var hPart = array[1];
			scriptletContext.put("vPart",vPart);
			scriptletContext.put("hPart",hPart);
		}
		scriptletResponse = "more";
	break;

	case "no more items":
		var vPart = scriptletContext.get("vPart");
		var hPart = scriptletContext.get("hPart");
		if(vPart != undefined && hPart != undefined) {
			scriptletResponse = "complete";
		}
		else {
			scriptletResponse = "failure";
			scriptletContext.put("FailureMessage","Empty VMname and/or Hostname convention for a given lab type: " + labID);
		}
	break;

	case udefined:
		scriptletResponse = "failure";
		scriptletContext.put("FailureMessage","Datatabse Error:" + output);
	break;
}
